package com.acmr.model.property;

public class Posi {
	private String row;
	private String col;

	public Posi() {
		// TODO Auto-generated constructor stub
	}

	public Posi(String row, String col) {
		super();
		this.row = row;
		this.col = col;
	}

	public String getRow() {
		return row;
	}

	public void setRow(String row) {
		this.row = row;
	}

	public String getCol() {
		return col;
	}

	public void setCol(String col) {
		this.col = col;
	}

}
